import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
    return ( 
        <nav className='text-5xl'>
        <ul className="nav-list">
            <img src="" alt="LOGO" />
            <li>
                <Link to='/'>Home</Link>
            </li>
            <li>
                <Link to='/about'>About</Link>
            </li>
            <li>
            <Link to='/map'>Map</Link>
            </li>
        </ul>
       </nav> 
     );
}
 
export default Navbar;
